import{_ as a,c as s,o as i,a5 as t}from"./chunks/framework.CqnjdYks.js";const e="/docs/cocos/assets/options.BXIOjLHm.png",r="data:image/png;base64,",n="data:image/png;base64,",l="/docs/cocos/assets/set-start-scene.BMrNA5Yb.png",p="/docs/cocos/assets/splash-setting.BPKeb1DO.png",q=JSON.parse('{"title":"构建选项介绍","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/editor/publish/build-options.md","filePath":"zh/manual/editor/publish/build-options.md"}'),h={name:"zh/manual/editor/publish/build-options.md"},o=t('<h1 id="构建选项介绍" tabindex="-1">构建选项介绍 <a class="header-anchor" href="#构建选项介绍" aria-label="Permalink to &quot;构建选项介绍&quot;">​</a></h1><h2 id="通用构建选项" tabindex="-1">通用构建选项 <a class="header-anchor" href="#通用构建选项" aria-label="Permalink to &quot;通用构建选项&quot;">​</a></h2><p><strong>构建发布</strong> 面板中的通用构建参数默认是按照平台区分的，如下：</p><p><img src="'+e+'" alt="build options"></p><h3 id="发布路径" tabindex="-1">发布路径 <a class="header-anchor" href="#发布路径" aria-label="Permalink to &quot;发布路径&quot;">​</a></h3><p>发布路径中包含两个输入框：</p><p><img src="'+r+'" alt="build path"></p><ul><li><p>第一个输入框用于指定项目的发布路径，可直接在输入框输入路径或者通过旁边的放大镜按钮选择路径。从 v3.1 开始支持切换使用以下两种路径：</p><p><img src="'+n+'" alt="path"></p><ul><li><strong>file</strong>：指定的发布路径为 <strong>绝对路径</strong>，也就是之前版本使用的方式。</li><li><strong>project</strong>：指定的发布路径为 <strong>相对路径</strong>，选择的路径只能在项目目录下。使用该种路径时，构建选项里一些与路径相关的（例如 icon 图标）配置便会以相对路径的方式记录，便于团队成员在不同设备上共享配置。</li></ul><p>默认的发布路径为项目目录的 <code>build</code> 文件夹下，如果您使用 Git、SVN 等版本控制系统，可以将 <code>build</code> 文件夹在版本控制中忽略。</p><blockquote><p><strong>注意</strong>：发布路径中不允许包含空格、非法字符以及中文。</p></blockquote></li><li><p>第二个输入框用于指定项目构建时的构建任务名称以及构建后生成的发布包名称。默认为当前构建平台名称，同个平台每多构建一次，便会在原来的基础上加上 <strong>-001</strong> 的后缀，以此类推。构建完成后可直接点击输入框后面的文件夹图标打开项目发布包所在目录。</p></li></ul><h3 id="初始场景" tabindex="-1">初始场景 <a class="header-anchor" href="#初始场景" aria-label="Permalink to &quot;初始场景&quot;">​</a></h3><p>设置打开游戏后进入的第一个场景。可以在 <strong>参与构建的场景</strong> 列表中搜索所需的场景，将鼠标移动到所需场景栏，然后点击右侧出现的按钮，即可将其设置为初始场景。</p><p><img src="'+l+`" alt="start scene"></p><h3 id="参与构建场景" tabindex="-1">参与构建场景 <a class="header-anchor" href="#参与构建场景" aria-label="Permalink to &quot;参与构建场景&quot;">​</a></h3><p>在构建过程中，除了项目目录下的 <code>resources</code> 文件夹以及 bundle 中的资源和脚本会全部打包外，其他资源都是根据参与构建的场景以及 bundle 中的资源引用情况来按需打包的。因而去除勾选不需要发布的场景，可以减少构建后生成的项目发布包包体体积。</p><h3 id="md5-缓存" tabindex="-1">MD5 缓存 <a class="header-anchor" href="#md5-缓存" aria-label="Permalink to &quot;MD5 缓存&quot;">​</a></h3><p>为构建后的所有资源文件名加上 MD5 信息，可以解决 CDN 或者浏览器资源缓存问题。</p><p>启用后，如果出现资源加载不了的情况，说明找不到重命名后的新文件。这通常是因为有些第三方资源没通过 <code>assetManager</code> 加载引起的。这时可以在加载前先用以下方法转换 URL，转换后的路径就能正确加载。</p><div class="language-typescript vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">typescript</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">const</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> uuid</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> =</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> assetManager.utils.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">getUuidFromURL</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(url);</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">url </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> assetManager.utils.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">getUrlWithUuid</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(uuid);</span></span></code></pre></div><blockquote><p><strong>注意</strong>：原生平台启用 MD5 Cache 后，如果出现资源加载不了的情况，通常是因为有些 C++ 中用到的第三方资源没通过 <code>assetManager</code> 加载引起的。也可以通过以下代码转换 URL 来解决：</p><div class="language-cpp vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">cpp</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">auto</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> cx </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> ScriptingCore</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">::</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">getInstance</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">()-&gt;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">getGlobalContext</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">();</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">JS</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">::</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">RootedValue</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> returnParam</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">cx</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">ScriptingCore</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">::</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">getInstance</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">()-&gt;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">evalString</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;cc.assetManager.utils.getUrlWithUuid(cc.assetManager.utils.getUuidFromURL(&#39;url&#39;))&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">, </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&amp;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">returnParam);</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">string url;</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">jsval_to_string</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(cx, returnParam, </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&amp;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">url);</span></span></code></pre></div></blockquote><h3 id="主包压缩类型" tabindex="-1">主包压缩类型 <a class="header-anchor" href="#主包压缩类型" aria-label="Permalink to &quot;主包压缩类型&quot;">​</a></h3><p>设置主包的压缩类型，具体内容可参考文档 <a href="./../../asset/bundle.html#压缩类型">Asset Bundle — 压缩类型</a>。</p><h3 id="配置主包为远程包" tabindex="-1">配置主包为远程包 <a class="header-anchor" href="#配置主包为远程包" aria-label="Permalink to &quot;配置主包为远程包&quot;">​</a></h3><p>该项为可选项，需要与 <strong>资源服务器地址</strong> 选项配合使用。 勾选后，主包会配置为远程包，并且与其相关依赖资源一起被构建到发布包目录 remote 下的 <a href="./../../asset/bundle.html#内置-asset-bundle">内置 Asset Bundle — main</a> 中。开发者需要将整个 remote 文件夹上传到远程服务器。</p><h3 id="资源服务器地址" tabindex="-1">资源服务器地址 <a class="header-anchor" href="#资源服务器地址" aria-label="Permalink to &quot;资源服务器地址&quot;">​</a></h3><p>填写后，将会在对应的远程服务器上下载配置了远程包的 bundle。</p><h3 id="使用构建内置服务器-实验室功能" tabindex="-1">使用构建内置服务器（实验室功能） <a class="header-anchor" href="#使用构建内置服务器-实验室功能" aria-label="Permalink to &quot;使用构建内置服务器（实验室功能）&quot;">​</a></h3><p>勾选后，无需再填写服务器地址，构建将会自动填充内置服务器地址，可用于快速验证 bundle 的 remote 功能。 需要注意的是，<strong>此选项仅作为开发测试使用，不可用于生产环境</strong>。构建内置服务器是本地搭建的 HTTP1 服务器，一些需要 HTTPS 服务器的游戏平台请关掉开发者工具域名校验或者不使用此功能自行搭建服务器，同时手机连接请保持和电脑在同一局域网下。</p><h3 id="调试模式" tabindex="-1">调试模式 <a class="header-anchor" href="#调试模式" aria-label="Permalink to &quot;调试模式&quot;">​</a></h3><p>若不勾选该项，则处于发布（release）模式，会对资源的 UUID、构建出来的引擎脚本和项目脚本进行压缩和混淆，并且对同类资源的 json 做分包处理，减少资源加载的次数。</p><p>若勾选该项，则处于调试模式，同时也可以配合勾选 Source Maps 选项，对项目进行调试，更方便定位问题。</p><h3 id="source-maps" tabindex="-1">Source Maps <a class="header-anchor" href="#source-maps" aria-label="Permalink to &quot;Source Maps&quot;">​</a></h3><p>如果需要生成 sourcemap，请勾选该项。构建时便会默认压缩引擎文件和项目脚本。</p><p>由于 JavaScript 脚本正变得越来越复杂，大部分源码（开发代码）都要经过编译转换才能投入生产环境，这就使实际运行的代码不同于源码，导致调试时无法定位到源代码。而 Source Map 可以将已转换的代码映射到源码，也就是将转换后的代码对应到转换前的源码的位置。这样在出现问题时，便可以直接查看和调试源码，定位问题更容易。详情可参考 <a href="https://developer.chrome.com/docs/devtools/javascript/source-maps/" target="_blank" rel="noreferrer">使用 source map</a>。</p><h3 id="替换插屏" tabindex="-1">替换插屏 <a class="header-anchor" href="#替换插屏" aria-label="Permalink to &quot;替换插屏&quot;">​</a></h3><p>鼠标移动到该选项时便会出现 <strong>编辑图标</strong> 的按钮，点击该按钮打开插屏设置面板，数据编辑后将会实时保存。可手动指定插屏图片路径，或者直接将文件系统的图片拖拽到图片处替换。</p><p><img src="`+p+'" alt="splash setting"></p><p>插屏的详细设置可以参考 <a href="./../project/">项目设置 - 插屏设置</a>。</p><h3 id="擦除模块结构-实验性质" tabindex="-1">擦除模块结构（实验性质） <a class="header-anchor" href="#擦除模块结构-实验性质" aria-label="Permalink to &quot;擦除模块结构（实验性质）&quot;">​</a></h3><p>若勾选该项，脚本导入速度更快，但无法使用模块特性，例如 <code>import.meta</code>、<code>import()</code> 等。</p><h3 id="跳过纹理压缩流程" tabindex="-1">跳过纹理压缩流程 <a class="header-anchor" href="#跳过纹理压缩流程" aria-label="Permalink to &quot;跳过纹理压缩流程&quot;">​</a></h3><p>默认为 <code>false</code>，若勾选该选项，则构建时会跳过整个纹理压缩流程，以减少构建时间。构建命令为：<code>skipCompressTexture</code>。</p><h3 id="cocos-service-配置集" tabindex="-1">Cocos Service 配置集 <a class="header-anchor" href="#cocos-service-配置集" aria-label="Permalink to &quot;Cocos Service 配置集&quot;">​</a></h3><p>该项用于显示当前项目在 <a href="https://service.cocos.com/document/zh/" target="_blank" rel="noreferrer">服务</a> 面板所集成的所有服务。</p><h2 id="各平台相关构建选项" tabindex="-1">各平台相关构建选项 <a class="header-anchor" href="#各平台相关构建选项" aria-label="Permalink to &quot;各平台相关构建选项&quot;">​</a></h2><p>由于目前构建机制上的调整，不同平台的处理均以插件的形式注入 <strong>构建发布</strong> 面板。在 <strong>构建发布</strong> 面板的 <strong>发布平台</strong> 中选择要构建的平台后，将会看到对应平台的展开选项，展开选项的名称便是平台插件名，在编辑器主菜单的 <strong>扩展 -&gt; 扩展管理器 -&gt; 内置</strong> 中可以看到各平台插件。</p><p>各平台相关构建选项，详情请参考：</p><ul><li><a href="./native-options.html#构建选项">发布到原生平台</a></li><li><a href="./publish-mini-game.html">发布到小游戏平台</a></li></ul><p>Cocos Creator 支持自定义构建扩展插件，处理方式与平台插件一致，详情可参考 <a href="./custom-build-plugin.html">自定义构建流程</a>。</p><h2 id="其他参与构建的参数配置" tabindex="-1">其他参与构建的参数配置 <a class="header-anchor" href="#其他参与构建的参数配置" aria-label="Permalink to &quot;其他参与构建的参数配置&quot;">​</a></h2><p>编辑器菜单栏 <strong>项目 -&gt; 项目设置</strong> 中的配置都会影响到项目构建的结果，详情请参考 <a href="./../project/">项目设置</a>。</p>',49),d=[o];function c(k,A,u,g,b,E){return i(),s("div",null,d)}const y=a(h,[["render",c]]);export{q as __pageData,y as default};
